    false,nt"url": null,nt"notes": "Bitterroot Restoration, Inc. (BRI) contracted
    with the U.S. Fish and Wildlife Service atBenton Lake National Wildlife Refuge (BLNWR)
    to conduct an inventory of existing wetland vegetation and habitat, and to create
    a map of vegetation types on the refuge. This report is on the assessment and results
    of the work conducted by BRI.  The field data collection was completed during the
    period from August 14 to October 1, 2001. The objective of this study is to characterize
    and quantify the wetland vegetation present on the BLNWR in terms of individual
    species, as well as vegetation types (habitat types and community types). This will
    be related spatially on a map created to present the vegetation data at a scale
    to show individual landform and vegetational features, such as small nesting islands
    and patches of bulrush. The project was designed for quantifying vegetative habitat
    values and liabilities, as well as for analyzing potential responses to various
    water management alternatives.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
